</div></div></div></div></div></div></div></div></section><div id="idskarsh" class="tI1Qp6 idskarsh"><div class="xPEAfP" data-testid="container-bg"></div><div data-mesh-id="idskarshinlineContent" data-testid="inline-content" class=""><div data-mesh-id="idskarshinlineContent-gridContainer" data-testid="mesh-container-content"><div id="idskarsh_0" class="BaOVQ8 tz5f0K idskarsh_0 wixui-text" data-testid="richTextElement"><h2 class="font_2" style="font-size:42px;"><span style="font-weight:bold;">COMPETENCY</span></h2>

<h2 class="font_2" style="font-size:42px;">AREAS</h2>
</div><div id="comp-iue7oxgf" class="BaOVQ8 tz5f0K comp-iue7oxgf wixui-text" data-testid="richTextElement"><h2 class="font_2" style="font-size:42px;"><span style="font-size:20px;">Our&nbsp;multi disciplinary approach allows us to specialize across the board apart from our main areas of &nbsp;Health &nbsp;Law &nbsp; Media Construction and Compliance</span></h2>
</div></div></div></div><div id="idskcwi3" class="BaOVQ8 tz5f0K idskcwi3 wixui-text" data-testid="richTextElement"><h6 class="font_6" style="font-size:20px;">CONSTRUCTION</h6>

<h6 class="font_6" style="font-size:14px;"><span style="font-size:14px;">From project conception,architectural designs, right down to engineering and civil works, we provide turnkey solutions tailored to client requirements. &nbsp;Project management, plant hire, engineering (structural, civil, electrical,mechanical) are serviced in-house.&nbsp;</span></h6>
</div><div id="idskdd4i" class="BaOVQ8 tz5f0K idskdd4i wixui-text" data-testid="richTextElement"><h6 class="font_6" style="font-size:20px;">LAW</h6>

<h6 class="font_6" style="line-height:0.9em; font-size:20px;"><span style="font-size:14px;">The Law department handles everything from keeping you the client law compliant, to litigation, company secretary services, to legal representation. Premium services include&nbsp;foreign&nbsp;company registration among other services</span></h6>
</div><div id="idskdpln_0" class="BaOVQ8 tz5f0K idskdpln_0 wixui-text" data-testid="richTextElement"><h6 class="font_6" style="font-size:20px;">MEDIA</h6>

<h6 class="font_6" style="font-size:14px;"><span style="font-size:14px;">Designing and running campaigns,experiential marketing,brand building, social media: Broadcast, Film and Theatre;&nbsp;just some of the tools we employ innovatively and interactively</span></h6>

<p class="font_8" style="font-size:16px;"><span class="wixGuard"></span></p>
</div><div id="idskdplo_1" class="BaOVQ8 tz5f0K idskdplo_1 wixui-text" data-testid="richTextElement"><h6 class="font_6" style="font-size:20px;">HEALTH</h6>

<p class="font_8" style="font-size:14px;"><span style="font-size:14px;">Setting up from scratch, running, provision of turnaround systems, mission based hospitals support, medical camps, Continous Medical Education&nbsp;and grand rounds are just the tip of our health iceberg</span></p>
</div><div id="idske2h1" class="BaOVQ8 tz5f0K idske2h1 wixui-text" data-testid="richTextElement"><h6 class="font_6" style="font-size:20px;">COMPLIANCE</h6>

<h6 class="font_6" style="line-height:0.9em; font-size:20px;"><span style="font-size:14px;">Weather it is&nbsp;certi</span><span style="font-size:14px;">fying your</span><span style="font-size:14px;"> construction project, registering your business or company, or tax obligations, here&#39;s a one stop shop</span></h6>

<h6 class="font_6" style="line-height:0.9em; font-size:20px;"><span style="font-size:14px;"><span class="wixGuard"></span></span></h6>
</div><div id="idske2h1_3" class="BaOVQ8 tz5f0K idske2h1_3 wixui-text" data-testid="richTextElement"><h6 class="font_6" style="font-size:20px;">AUDITING</h6>

<p class="font_8" style="font-size:14px;"><span style="font-size:14px;">Numbers are integral to any enterprise. Getting them right is a vital ingredient to success. Here at Bogg Standard Tax,Fiscal,Forensic,Payroll&nbsp;and Legal Auditing bear one thing in common: Accuracy and Professionalism.</span></p>

<p class="font_8" style="font-size:14px;"><span style="font-size:14px;"><span class="wixGuard"></span></span></p>

