</div><div id="idskfcfr" class="BaOVQ8 tz5f0K idskfcfr wixui-text" data-testid="richTextElement"><p class="font_8" style="line-height:1.5em; text-align:center; font-size:16px;"><span class="color_11"><span>In every business, practice or firm, there comes a time when the business, practice or firm&nbsp;plateaus. Hits the proverbial wall. Appears to have achieved the zenith of growth. This is where we come in. Eking out your undiscovered reserve and potential to give you your phoenix moment of rebirth.</span></span></p>

<p class="font_8" style="line-height:1.5em; text-align:center; font-size:16px;"><span class="color_11"><span>Be it a startup, seasoned enterprise or just looking to expand customer base, increase revenue, streamline productivity, we have tailor made solutions for you. From ab initio (company registration, compliance) to fiscal audits,business plan implementation, forensic audits to filing tax returns, forensic audits, and even human resource, resource management, each clients specific needs are identified and addressed. We form a symbiosis that leaves you the client better off than when we first interacted.</span></span></p>

<p class="font_8" style="line-height:1.5em; text-align:center; font-size:16px;"><span class="color_11"><span>At Bogg Standard Associates, we are passionate in every field. Weather its Media, Health or Law, our&nbsp;characteristic attention to detail and subsequent client satisfaction is testament enough. From Media Campaigns, to setting up medical facilities, to designing and running political campaigns, from legal clinics to handling unique cases for our clients... time and&nbsp;time again we deliver&nbsp;</span></span></p>

<p class="font_8" style="line-height:1.5em; text-align:center; font-size:16px;"><span class="color_11"><span>We are a New kind of agency. We are a Multidisciplinary&nbsp;agency. We are a focused, creative, Blue Sky Thinking&nbsp;oriented, one-of-a-kind Kenyan based agency, aiming to, through you the client, rewrite the known standards of achievement and innovation.</span></span><br />
&nbsp;</p>

<p class="font_8" style="line-height:1.5em; text-align:center; font-size:16px;"><span class="color_11"><span><span class="wixGuard"></span></span></span></p>
</div></div></div></div></div></section><div id="idskjt08" class="Vd6aQZ ignore-focus idskjt08" tabindex="-1" role="region" aria-label="practice_areas"><span class="mHZSwn">practice_areas</span></div><div id="idskkw5e" class="Vd6aQZ ignore-focus idskkw5e" tabindex="-1" role="region" aria-label="our_vision"><span class="mHZSwn">our_vision</span></div><div id="comp-iucpc2wg" class="comp-iucpc2wg I7M4CO QjPSrk ignore-focus" role="region" tabindex="-1" aria-label="Slideshow"><button data-testid="prevButton" aria-label="Previous" class="PBM28h LeOpDH"><svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 21 41"><path d="M20.3 40.8 0 20.5 20.3.2l.7.7L1.3 20.5 21 40.1z"></path></svg></button><button data-testid="nextButton" aria-label="Next" class="PBM28h QFf6js"><svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 21 41"><path d="M20.3 40.8 0 20.5 20.3.2l.7.7L1.3 20.5 21 40.1z"></path></svg></button><div data-testid="slidesWrapper" aria-live="off" class="WB4GU7"><div id="comp-iucpc35d" class="comp-iucpc35d VUwMqR"><div id="bgLayers_comp-iucpc35d" data-hook="bgLayers" class="MW5IWV TVPXMW"><div data-testid="colorUnderlay" class="LWbAav Kv1aVt"></div><div id="bgMedia_comp-iucpc35d" class="VgO9Yg"><wow-image id="img_comp-iucpc35d" class="HlRz5e Kv1aVt dLPlxY mNGsUM bgImage" data-image-info="{&quot;containerId&quot;:&quot;comp-iucpc35d&quot;,&quot;alignType&quot;:&quot;center&quot;,&quot;displayMode&quot;:&quot;fill&quot;,&quot;targetWidth&quot;:1240,&quot;targetHeight&quot;:510,&quot;isLQIP&quot;:true,&quot;imageData&quot;:{&quot;width&quot;:2560,&quot;height&quot;:1440,&quot;uri&quot;:&quot;035244_325d75fa2d474a02b1315b32a0a19bae.jpg&quot;,&quot;name&quot;:&quot;&quot;,&quot;displayMode&quot;:&quot;fill&quot;,&quot;quality&quot;:{}}}" data-bg-effect-name="" data-has-ssr-src="true"><img src="https://static.wixstatic.com/media/035244_325d75fa2d474a02b1315b32a0a19bae.jpg/v1/fill/w_136,h_77,al_c,q_80,usm_0.66_1.00_0.01,blur_2,enc_auto/035244_325d75fa2d474a02b1315b32a0a19bae.jpg"